import React from "react";

function PrintLines({ selectedLines }) {
  return (
    <div>
      {selectedLines.map((line, index) => (
        <div key={index} className={line.level}>
          {line.level}: {line.value}
        </div>
      ))}
    </div>
  );
}

export default PrintLines;
